import React from 'react'
import './css/login.css'

function Login() {

  return (
    <div className='loginScreen'>

        <form>
          <h3>Make the most of your professional life</h3>
            <label htmlFor="FullName">Email or phonenumber</label>
            <input type="text"  />

            <label htmlFor="link for profile picture">Profile picture URL</label>
            <input type="text"  />

            <label htmlFor="FullName">Password (6 or more characters)</label>
            <input type="text"  />

            <input type="submit" value= "Agree & Join" />

            <h4>Already on LinkedIn? <span >Sign in</span> </h4>

        </form>


        <form >
          <input type="email" placeholder='Email or Phone' />
          <input type="password" placeholder='Password' />
          <h3>Forgot Password?</h3>

          <input type="submit" value="Sign in" />
          <h4>New to LinkedIn? <span >Join now</span> </h4>

        </form>
    </div>
  )
}
